import React, { useState } from "react";
import "antd/dist/antd.css";
import { Drawer, Button, Col, Row } from "antd";
import TestCard from "./Components/card";

export default function App() {
  const [visible, setVisible] = useState(false);

  return (
    <div
      style={{
        display: "block",
        width: 700,
        padding: 30,
      }}
    >
      <h4>Testing Component</h4>

      <>
        <Button
          type="primary"
          onClick={() => {
            setVisible(true);
          }}
        >
          Open
        </Button>
        <Drawer
          title="Home / Device Statistics"
          style={{ color: "white" }}
          maskStyle={{
            color: "white",
          }}
          headerStyle={{
            // backgroundColor: "#16151B",
            backgroundColor: "white",
            borderBottomWidth: 0,
          }}
          bodyStyle={{
            backgroundColor: "#16151B",
            color: "white",
          }}
          width={"50%"}
          placement="right"
          closable={true}
          keyboard={true}
          visible={visible}
          onClose={() => {
            setVisible(false);
          }}
        >
          <div>
            <Row>
              <Col span={12}>
                <TestCard />
              </Col>
              <Col span={12}>
                <TestCard />
              </Col>
            </Row>
          </div>
        </Drawer>
      </>
    </div>
  );
}
